import "./App.css";
import Data from "./DataProduct/Data";

function App() {
  return (
    <div>
      <header>BomBam Shop</header>
      <main>
        <h1>สินค้า</h1>
        {Data.product.map((product) => (
          <div>
            <img src={product.image} alt={product.name} />
            <p>{product.name}</p>
            <p>{product.price}</p>
          </div>
        ))}
      </main>
    </div>
  );
}

export default App;
